// PrivateRoute.js
import React from 'react';
import { Route, Navigate } from 'react-router-dom';

const PrivateRoute = ({ isAuthenticated, element }) => {
  return isAuthenticated ? <Route element={element} /> : <Navigate to="/login" />;
};

export default PrivateRoute;
